7819	7867	Derek A. Rhodes	English, haskell, python, go	New Hampshire	{"6002x_exit_response": {"rating": ["7 - Absolutely amazing. I learned a great deal."], "improvement_textbook": ["I'm not in a position to judge the quality of the text :).  It had lots of good examples, with regards to the content it's great for this course."], "future_offerings": ["true"], "age": ["35"], "university_comparison": ["I have not taken an equivalent university class."], "engineering": ["Bachelor's degree"], "future_classes": ["true"], "future_updates": ["true"], "favorite_parts": ["The platform is better than Udacity and Coursera.  Coursera has you guys beat on the video widget though.  The sooner you opensource it, the sooner we can help build it. \\r\\n\\r\\nAs to the potential of online learning and how MITx presently fits.  The absolute most one can expect from this experience like that of a one on one conversation with a both infinitely knowledgeable and patient teacher that has mind rays to determine exactly what misconceptions exist.  There is no mind ray.  If there was a way to present problems that unfolded from difficult to easy, then this might be close.\\r\\n\\r\\nWhat is 5^3 equal to?  (Assume you don't know exponents, then you're in a conundrum)\\r\\n(click on hint)\\r\\nWhat is (5*5*5) equal to? (Assume you don't know how to multiply)\\r\\n(click on hint)\\r\\nWhat is ((5+5+5+5+5)*5) equal to?\\r\\n\\r\\nSo, if there is a way to decompose a problem into its smallest steps, then a recursive system of hints could be implemented that reveals the minimum amount of information necessary for any given student.   Once the problem has been solve, the next step is to randomly generate new parameters for the same problem, and let the student try again.  This time hopefully less hinting would be needed, until finally none is needed.   I don't know how practical this would be.\\r\\n\\r\\n--\\r\\nThere is a music service called soundcloud where time coded comments are used to tie feedback to a part of a song.  If students could have clarifying discussion around confusing parts of lectures directly on the lecture page, exactly at the point of confusion, the context would be immediately available for helpers to help.   Questions would be asked that otherwise wouldn't because of the effort required to explain the context. (I bet) \\r\\n\\r\\n-- \\r\\nThis following programming text has a nice feature that allows the reader to make inline comments.\\r\\nhttp://book.realworldhaskell.org/read/getting-started.html\\r\\n\\r\\n"], "rating_textbook": ["6"]}}	course.xml	NULL	NULL	NULL	NULL	NULL	1	US	NULL	NULL	NULL
