96162	96940	Calvin Hsieh	English	California	{"6002x_exit_response": {"rating": ["6"], "teach_ee": ["I do not teach EE."], "future_offerings": ["true"], "improvement_ideas": ["I posted this in this discussion forum. I am reproducing it here for your convenience. (I did not include the first and last paragraphs, which are irrelevant.)\\r\\nhttps://6002x.mitx.mit.edu/discussion/question/98002/suggestions-for-future-revised-long\\r\\n\\r\\nMy suggestions are mainly about the format of the course, which retains the traditional model of evaluating students. If MITx / edX is to be truly innovative, it has to be willing to break free from the old model. Here are the suggestions.\\r\\n\\r\\n1: Progress bar chart: Use it to show us what we have completed and what else we need to work on to achieve competency; do not use it to tell us what we can no longer change. Currently, the progress chart is used in this way only on a weekly basis. But once a weekly deadline is passed, there is NOTHING that we can do to improve our \\"progress\\" for the subject covered in that week! We can only stare at the progress bar and wish, helplessly, that we had done better in the past. In other words, a helpful \\"debugging\\" tool has become an unchangeable reminder of past failure!\\r\\n\\r\\nFor it to be a true progress chart, two important things have to change: inflexible scheduling (deadlines), and mistakes that cannot be fixed (grades).\\r\\n\\r\\n2: Deadlines: Make the pace of the course more flexible. By allowing a student to adjust the pace as needed, he / she can slow down and spend more time on areas of weakness, and speed up on easier topics. The student will learn more thoroughly. If we must be given rigid deadlines, give us \\"useful\\" penalties for missing a weekly deadline. If we cannot complete one problem by the weekly deadline, it is not constructive to just downgrade us. Instead, give us a penalty problem to solve. That way, we would learn something new while being \\"punished\\".\\r\\n\\r\\n(Under this system, some students will repeatedly miss weekly deadlines because they think they will just do more problems by the end of the course. They will pile up a lot of work to do at the end. But that is not a problem as long as there is enough time at the end to allow them to catch up with late work.)\\r\\n\\r\\n3: Grades: Eliminate the concept of a weekly grade (whether percentage or letter based), which is an unchangeable judgment of our ability to solve problems in the past. Instead, consider the concept of percentage completion at this moment, which tells us the percentage of problems in a given area that we have completed so far, and allow us to go back to complete the problems at a later time (perhaps weeks later) if necessary.\\r\\n\\r\\nStudents are not always able to solve problems on their own. But given enough example solutions, they will learn the solution approach. So my suggestion is this: If we cannot solve a problem after a certain number of attempts (let's say 5 attempts, for example), give us a detail step-by-step guide leading us through the solution process without explicitly giving us the answer. (This should require a time delay, which could be as long as a day, after each attempt to prevent people from giving up too easily. Also, provide a complete solution if people are unable to continue even after given a step-by-step guide.) Then give us a similar problem to solve, again with 5 attempts. Repeat until we are able to solve that problem type without help. We should be allowed to ask people for help, because the solution guide may not be clear enough.\\r\\n\\r\\nAnd this should also extend to the \\u201cexams\\u201d, which are just collections of problems for us to complete. After the exam deadline, the exam problems should be treated just like the homework problems. That is, provide us with a step-by-step guide for any incomplete / incorrect answer, then give us a similar problem, and repeat until the problem type can be completely solved without help. The final completion score of the exam should reflect our score after we have been given the chance to improve our completion score. In other words, it should be possible for every student to achieve 100% completion score for every exam even after the exam deadline is passed.\\r\\n\\r\\n4: Honor code: By essentially giving away the solution to each problem and allowing people to improve their exam scores, the honor code will not be necessary. Besides, it is a waste of time to try to catch online \\u201ccheaters\\u201d. People will always figure out a way to cheat if they wish. Instead, why not just lower the incentive to cheat? By allowing unrestricted score improvement after deadlines, there will be very little incentive for students to cheat. Instead, the students will be encouraged to learn how to solve problems.\\r\\n\\r\\n5: Certification: Certificates should be given based on percentage completion. Since answers were essentially given for every problem, the requirement for certificates should be really high. I suggest at least 85% completion for the award of certificates. And different certificates can be given for different levels of completion. If MITx / edX is required (for whatever reason) to grade us, give us grades based on percentage completion at the end of the course.\\r\\n\\r\\nBy relaxing the deadlines and allowing people to improve their scores, the course will become easier for many struggling students. The progress chart will become a truly useful feedback tool, encouraging them to learn. And I suspect they will learn better too.\\r\\n\\r\\nIt may seem like my suggestions are reducing the value of the certificate by making the course too easy. But which is a better goal: To show people how difficult it is to obtain an MITx certificate (and perhaps to identify bright students, among other reasons), or to truly educate the world?\\r\\n"], "work_offline": ["I worked completely on my own."], "future_classes": ["true"], "math_level": ["Vector calculus or differential equations"], "future_updates": ["true"], "favorite_parts": ["Great lectures. Easy to understand. "]}}	course.xml	NULL	NULL	NULL	NULL	NULL	1	NULL	NULL	NULL	NULL
